// source: https://batmanbrony.deviantart.com/art/Pinkie-Bounce-409303322

function Pinkie(url) {
    this.img_url = url || pinkie_gif;
}
Pinkie.prototype = {
    last_pos: 0,  // stores the last position, to allow flipping it
    is_tilt: false,
    id: "jumping-pinkie",
    //img_url = "https://derpicdn.net/img/view/2013/10/25/455837.gif",
    img_url: pinkie_gif,
    click_will_close: false, // change this to true to allow deletion by click/tab.
    element: null, // jquery instance of pinkie
    visible: false, // will be true when shown, false if not.
    log: function () {  // set this to some other function to shut Pinkie's logging up.
        return console.log.apply(console, arguments);
    },
    calc_scale: function () {
        var ratio = (window.devicePixelRatio || 1);
        var w = $(window);
        var pixel_factor = 1 / ratio;  // normal -> 1, retina -> 0.5
        if (w.width() < 700 || w.height() < 700) {
            return 0.5;
        } else if (w.width() > 1920) {
            return 1;
        }
        return pixel_factor;
    },
    calc_maxsize: function (apply) {
        if (apply) {
            return this.element.css(this.calc_maxsize());
        }
        var scale = this.calc_scale();
        return {
            "max-height": "" + (500 * scale) + "px",
            "max-width": "" + (500 * scale) + "px"
        };
    },
    remove: function () {
        this.unbind();
        if (this.element) {
            this.element.remove();
            this.log("Poof, I'm gone.")
        }
        this.visible = false;
    },
    create: function () {
        this.log("It is happening!");
        if (this.element === null) {
            // only create if not created yet.
            var img = $('<img/>');
            img.addClass("pinkie");
            img.attr("id", this.id);
            img.attr("src", this.img_url);
            var scale = this.calc_scale();
            var css = {
                "z-index": 10000,
                "position": "fixed",
                "display": "block",
                "right": 0,
                "bottom": 0,
                "pointer-events": "none"
            };
            this.log(css);
            img.css(css);
            img.css(this.calc_maxsize());
            this.element = img;
        }
        this.element.appendTo(document.body);
        this.visible = true;
        this.bind();
    },
    onclickCreate: function (selector) {
        $( selector ).on("click.pinkie", function(e) {
            e.stopPropagation();
            this.create.bind(this)();
        }.bind(this));
    },
    onclickRemove: function (selector) {
        $( selector ).on("click.pinkie", function(e) {
            e.stopPropagation();
            this.remove.bind(this)();
        }.bind(this));
    },
    calc_side: function (new_pos, flip_on, flip_off, rotate) {
        if (new_pos === this.last_pos) {
            return {};
        }
        var flip = (new_pos > this.last_pos ? flip_on : flip_off);
        flip = (rotate !== undefined ? flip + " " + rotate : flip);
        this.last_pos = new_pos;
        return {
            "transform": flip,
            "-moz-transform": flip,
            "-webkit-transform": flip,
            "-o-transform": flip,
            "-khtml-transform": flip,
            "-ms-transform": flip
        }
    },

    //http://jsfiddle.net/26n8hf4e/
    onOrient: function (e) {
        var t = e.originalEvent || e;
        if (t.gamma) {
            self.is_tilt = true;
        }
        var elem = this.element;
        var degree = t.gamma;
        var w = $(window).width(),
            h = $(window).height();
        var e_w = this.element.width(),
            e_h = this.element.height();
        var new_pos = 0;
        var flip_on = "scale(-1, 1)",
            flip_off = "";
        var rotation;
        var css = {};
        if (degree < -45 && degree > -135) { // left
            new_pos = (((degree) + 45) / 90 * (h - e_h) * -1);
            css["bottom"] = new_pos + "px";
            css["left"] = 0;
            css["top"] = "";
            css["right"] = "";
            flip_on = "";
            flip_off = "scale(1, -1)";
            rotation = 90;
        } else if (degree > -45 && degree < 45) { // bottom
            new_pos = ((degree + 45) / 90 * (w - e_w));
            css["bottom"] = 0;
            css["left"] = new_pos + "px";
            css["top"] = "";
            css["right"] = "";
            flip_on = "scale(-1, 1)";
            flip_off = "";
            rotation = 0;
        } else if (degree === 45) { // bottom-right
            new_pos = ((degree - 45) / 90 * (h - e_h));
            css["bottom"] = new_pos + "px";
            css["left"] = "";
            css["right"] = 0;
            css["top"] = "";
            rotation = -45;
        } else if (degree > 45 && degree < 135) { // right
            new_pos = ((degree - 45) / 90 * h);
            css["bottom"] = new_pos + "px";
            css["left"] = "";
            css["right"] = 0;
            css["top"] = "";
            flip_on = "scale(1, -1)";
            flip_off = "";
            rotation = -90;
        }
        //var rotation = degree * -1;
        var rotate = 'rotate(' + rotation + 'deg)';
        css = $.extend(css, this.calc_side(new_pos, flip_on, flip_off, rotate));
        this.element.css(css);
    },
    setPos: function (e) {
        if (self.is_tilt) {
            return;
        }
        var w = $(window).width(),
            e_w = this.element.width();
        var new_pos = (x / w) * (w - e_w);
        var css = {};
        css["top"] = "";
        css["bottom"] = 0;
        css["right"] = "";
        css["left"] = new_pos + "px";
        css = $.extend(css, this.calc_side(new_pos, "scale(-1, 1)", ""));
        this.element.css(css);
    },
    onMove: function (e) {
        x = e.pageX;
        this.setPos(x);
    },
    onTouchMove: function (e) {
        var touch = e.touches[0],
            x = touch.pageX;
        this.setPos(x);
    },
    onClick: function (e) {
        this.log("boop");
        if (this.click_will_close) {
            this.remove();
        }
    },
    bind: function () {
        this.log("Uuuuuh listening to so many events. Clicks, mouse movements, gravity, twitchy tail,...");
        $(document)
            .on("click.pinkie", this.onClick.bind(this))
            .on('mousemove.pinkie', this.onMove.bind(this))
            .on('touchmove.pinkie', this.onTouchMove.bind(this))
            .on('touchstart.pinkie', this.onTouchMove.bind(this));
        if (window.DeviceOrientationEvent) {
            $(window).on("deviceorientation.pinkie", this.onOrient.bind(this));
            //window.addEventListener("deviceorientation", this.onOrient.bind(this), false);
        }
    },
    unbind: function () {
        this.log("Ok, enough. Turning off my Pinkiesense.");
        $(document).off('.pinkie');
        $(window).off(".pinkie");
        this.element.off(".pinkie");
    },
    registerEastereggClass: function () {
        var easteregg = $(".easteregg");
        easteregg.css("cursor", "pointer");
        this.onclickCreate(easteregg);
    },
    checkAprilFool: function () {
        var date = new Date();
        if (date.getDate() === 1 && date.getMonth() === 4) {
            this.create();
        }
    },
    beReady: function (disableAutostart,disableFirstApril, disableEastereggClass) {
        // attach several function to the body onload event
        // Using .bind else `this` would later be the document, and not this instance.
        if(!disableAutostart) {
            $(this.create.bind(this));
        }
        if(!!disableAutostart && !disableFirstApril) {
            $(this.checkAprilFool.bind(this));
        }
        if (!disableEastereggClass) {
            $(this.registerEastereggClass.bind(this));
        }
        this.log("Pinkie is ready!");
        return this;
    }
};